import React, { useEffect, useState } from "react";
import icon from "../assets/person-icon-1.png";

const Profile = () => {
    const [user, setUser] = useState({
        name: "",
        email: "",
        joined: "",
        quizzesCompleted: 0,
        averageScore: "0%",
        questionsAnswered: 0,
    });

    useEffect(() => {
        const userID = localStorage.getItem("userID");
        console.log("USER ID:",userID);

        const fetchUserInfo = async () => {
            const res = await fetch(`https://localhost:3001/api/user/${userID}`);
            const data = await res.json();
            setUser(prev => ({
                ...prev,
                name: data.username,
                email: data.email,
                joined: new Date(data.joined).toLocaleString("default", { month: "long", year: "numeric" }),
            }));
        };

        const fetchStats = async () => {
            try {
                const res = await fetch(`https://localhost:3001/api/result/attempts/${userID}`);
                const attempts = await res.json();

                const quizzesCompleted = attempts.length;

                let totalScore = 0;
                let totalPossible = 0;
                let totalQuestionsAnswered = 0;

                attempts.forEach(attempt => {
                    totalScore += attempt.score;
                    totalPossible += attempt.totalQuestions;
                    totalQuestionsAnswered += attempt.totalQuestions;
                });

                console.log("Total Score: ", totalScore);

                const averageScore = totalPossible > 0
                    ? `${Math.round((totalScore / totalPossible) * 100)}%`
                    : "0%";

                setUser(prev => ({
                    ...prev,
                    quizzesCompleted,
                    averageScore,
                    questionsAnswered: totalQuestionsAnswered,
                }));
            } catch (err) {
                console.error("Failed to fetch stats:", err);
            }
        };        

        fetchUserInfo();
        fetchStats();
    }, []);

    return (
        <div className="d-flex justify-content-center align-items-center vh-100 bg-secondary">
          <div className="bg-secondary rounded-4 shadow-lg p-4" style={{ width: '100%', maxWidth: '450px', position: 'relative', textAlign: 'center' }}>

            {/* Profile Picture */}
            <div style={{ position: 'absolute', top: '-60px', left: '50%', transform: 'translateX(-50%)' }}>
              <img 
                src={icon} 
                alt="Profile" 
                className="rounded-circle" 
                style={{ width: '120px', height: '120px', objectFit: 'cover', border: '5px solid white', boxShadow: '0 4px 20px rgba(0,0,0,0.2)' }}
              />
            </div>

            {/* Top Buttons */}
            <div className="d-flex justify-content-between mt-5 px-3">
              <div style={{ color: '#ff6a85', fontSize: '14px', cursor: 'pointer' }}>
                <i className="bi bi-person-plus" style={{ marginRight: '4px' }}></i> Connect
              </div>
              <div style={{ color: '#ff6a85', fontSize: '14px', cursor: 'pointer' }}>
                <i className="bi bi-chat-dots" style={{ marginRight: '4px' }}></i> Message
              </div>
            </div>

            {/* User Info */}
            <div className="mt-3">
              <h3 className="fw-bold text-white mb-1">{user.name}</h3>
              <p className="text-white mb-1">{user.email}</p>
              <p className="text-white" style={{ fontSize: '14px' }}>Joined {user.joined}</p>
            </div>

            {/* Stats */}
            <div className="d-flex justify-content-around my-4">
              <div>
                <h4 className="fw-bold mb-0">{user.quizzesCompleted}</h4>
                <small className="text-white">Quizzes</small>
              </div>
              <div>
                <h4 className="fw-bold text-info mb-0">{user.averageScore}</h4>
                <small className="text-white">Avg Score</small>
              </div>
              <div>
                <h4 className="fw-bold text-red mb-0">{user.questionsAnswered}</h4>
                <small className="text-white">Questions</small>
              </div>
            </div>

            {/* Show More Button */}
            <button className="btn btn-danger rounded-pill px-4">Show more</button>

          </div>
        </div>
    );
};

export default Profile;
